/**
 * Returns the length of a Subform or -1 if no length can be found
 * @param  {array} s Subform element
 * @return {int}   length of the Subform, or -1
 */
function getSubformLength(s) {
   if(typeof s === "undefined" || s == null || Array.isArray(s) === false) {
      return -1;
   } else {
      return s.length;
   }
}

/**
 * Build full name based on three string values, will not double space
 * @param  {string} f first name
 * @param  {string} m middle name
 * @param  {string} l last name
 * @return {string}   three strings joined by space
 */
function makePersonFullName(f,m,l) {
   var full_name = [];
   if(typeof f === "string" && f.trim().length > 0) { full_name.push(f); }
   if(typeof m === "string" && m.trim().length > 0) { full_name.push(m); }
   if(typeof l === "string" && l.trim().length > 0) { full_name.push(l); }

   return full_name.join(" ");
}

/**
 * Build identifier for person using full name and national id
 * @param  {string} full_name   full name of a person
 * @param  {string} national_id national identification value
 * @return {string}             identifier in the format: full name (national identification)
 */
function makePersonIdentifier(full_name,national_id) {
   return full_name + " (" + String(national_id) + ")";
}

/**
 * Build address from components, if component is not filled in, will be skipped
 * @param  {string} plot_num  plot number (if applicable)
 * @param  {string} unit_num  apartment or unit number (if applicable)
 * @param  {string} parish    parish
 * @param  {string} subcounty subcounty
 * @param  {string} county    county
 * @param  {string} district  district
 * @param  {string} region    region
 * @param  {string} country   country
 * @return {string}           combined address with pound symbol (#) prepended to apartment/unit number
 */
function makeAddress(plot_num,unit_num,street_name,parish,subcounty,county,district,region,country) {
   var address = [];
   if(typeof plot_num === "string" && plot_num.trim().length > 0) { address.push(plot_num); }
   if(typeof unit_num === "string" && unit_num.trim().length > 0) { address.push(String("#"+unit_num)); }
   if(typeof street_name === "string" && street_name.trim().length > 0) { address.push(street_name); }
   if(typeof parish === "string" && parish.trim().length > 0) { address.push(parish); }
   if(typeof subcounty === "string" && subcounty.trim().length > 0) { address.push(subcounty); }
   if(typeof county === "string" && county.trim().length > 0) { address.push(county); }
   if(typeof district === "string" && district.trim().length > 0) { address.push(district); }
   if(typeof region === "string" && region.trim().length > 0) { address.push(region); }
   if(typeof country === "string" && country.trim().length > 0) { address.push(country); }

   return address.join(" ");
}

/**
 * Caclulate the value of the property based on area and mill rate
 * @param  {string} area size of land rounded to two decimals
 * @return {string}      calculated property valuation rounded to two decimals
 */
function calcPropertyValuation(area) {
   var conversion = 700000;
   return (Number(area) * conversion).toFixed(0).replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

/**
 * Calculate the taxation amount for the property based on valuation
 * @param  {string} v valuation of property rounded to two decimals
 * @return {string}   calculated taxation amount rounded to two decimals
 */
function calcPropertyTaxationAmount(v) {
   var tax_rate = 0.03;
   return (Number(v.replace(/,/g,"")) * tax_rate).toFixed(0).replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

/**
 * Calculate annual rental taxation amount based on monthly rent
 * @param  {double} monthly_rent monthly rent
 * @return {double}              calculated annual tax rate rounded to two decimals
 */
function calcAnnualRentalTaxationAmount(monthly_rent) {
  var annual_rent = monthly_rent * 12;
  return ((annual_rent * 0.80) * 0.20).toFixed(0).replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

/**
 * Reviews form values and ensures registration record has been completed correctly
 * @param  {int}     is_property_registered        Select element, Yes = 0, No = 1
 * @param  {array}   new_property                  Single-paging Subform
 * @param  {string}  select_property               Lookup from registered properties
 * @param  {int}     register_person_with_property Select element, Yes = 0, No = 1
 * @param  {int}     is_person_registered          Select element, Yes = 0, No = 1
 * @param  {array}   new_person                    Single-paging Subform
 * @param  {string}  select_person                 Lookup from registered persons
 * @param  {int}     registration_relationship     Select element, Owner = 0, Landlord = 1, Renter/Tenant = 2
 * @return {string}                                Empty string if successfully completed, or error message to be displayed
 */
function validateRecord(is_property_registered, new_property, select_property, register_person_with_property, is_person_registered, new_person, select_person, registration_relationship) {
   var text = "";

   // existing property not selected
   if(is_property_registered === 0 && select_property.trim().length === 0) {
      text = "Existing property not selected";
   }

   // new property not registered
   if(is_property_registered === 1 && getSubformLength(new_property) <= 0) {
      text = "New property not registered";
   }

   // existing person not selected
   if(is_person_registered === 0 && select_person.trim().length === 0) {
      text = "Existing person not selected";
   }

   // new person not registered
   if(is_person_registered === 1 && getSubformLength(new_person) <= 0) {
      text = "New person not registered";
   }

   return text;
}

